"""
This file contains HTML script to display Map images based on Dialogflow intent and entity detection.
"""
class Maps:
    def show_maps(place):
        html_floor_plan_campus = '<img class="img-fluid" style="width:40rem" data-value="13" src="data:image/png;base64,">'
        html_floor_plan_bg = '<img class="img-fluid" style="width:25rem" data-value="1" src="data:image/png;base64,">'
        html_floor_plan_cafetaria = '<img class="img-fluid" style="width:25rem" data-value="2" src="data:image/png;base64,">'
        html_floor_plan_escalator = '<img class="img-fluid" style="width:25rem" data-value="3" src="data:image/png;base64,">'
        html_floor_plan_firstfloor = '<img class="img-fluid" style="width:25rem" data-value="4" src="data:image/png;base64,">'
        html_floor_plan_floor2_theatre3 = '<img class="img-fluid" style="width:25rem" data-value="5" src="data:image/png;base64,">'
        html_floor_plan_floor2_theatre45 = '<img class="img-fluid" style="width:25rem" data-value="6" src="data:image/png;base64,">'
        html_floor_plan_lifta = '<img class="img-fluid" style="width:25rem" data-value="7" src="data:image/png;base64,">'
        html_floor_plan_liftb = '<img class="img-fluid" style="width:25rem" data-value="8" src="data:image/png;base64,">'
        html_floor_plan_secondfloor = '<img class="img-fluid" style="width:25rem" data-value="9" src="data:image/png;base64,">'
        html_floor_plan_theatre1 = '<img class="img-fluid" style="width:25rem" data-value="10" src="data:image/png;base64,">'
        html_floor_plan_theatre2 = '<img class="img-fluid" style="width:25rem" data-value="11" src="data:image/png;base64,">'
        html_floor_plan_toilets = '<img class="img-fluid" style="width:25rem" data-value="12" src="data:image/png;base64,">'
        if place == "Toilet":
            return html_floor_plan_toilets
        elif place in ["Lift Wing A", "Computer science", "Mathematics", "Environmental study", "SAIL AI LAB", "Robot Lab", "Marketing", "UCGB", "VU Education Lab", "Beta Common room", "Rialto/Griffoen Office"]:
            return html_floor_plan_lifta
        elif place in ["Nursing", "Lift Wing B", "Cinema", "lecture", "Theater 6", "Theater 7", "Theater 8", "Theater 9", "Network Institute Tech Labs", "Physical Computing Education Lab", "Hardware/Multipurpose Lab"]:
            return html_floor_plan_liftb
        elif place in ["NU Building", "Lift", "Study", "parking", "room", "Firstaid"]:
            return html_floor_plan_bg
        elif place == "Cafeteria":
            return html_floor_plan_cafetaria
        elif place == "Theater 1":
            return html_floor_plan_theatre1
        elif place == "Theater 2":
            return html_floor_plan_theatre2
        elif place == "Theater 3":
            return html_floor_plan_floor2_theatre3
        elif place in ["Theater 4", "Theater 5"]:
            return html_floor_plan_floor2_theatre45
        elif place == "Meeting rooms":
            return html_floor_plan_secondfloor
        else:
            return html_floor_plan_campus

    def return_qr_survey(self):
        html_survey = '<img class="img-fluid" style="width:30rem" data-value="13" src="data:image/png;base64,">'
        return html_survey

